function HowToJoin() {
  return (
      
    <div class="main" id="sign-up">
        <div class="main-container">
            <div class="main-content">
                <h1>Join our team</h1>
                <h2>Sign Up Today</h2>
                <p>See what makes us different</p>
                <button class = "mainButton"><a href="#">Sign Up</a></button>
            </div>
            <div class="main-imgContainer">
                <div class="main-imgCard"><i class="fas fa-users"></i>
                </div>
            </div>
        </div>
    </div>
  );
}

export default HowToJoin;
